window.topolr.source({"packet":[{"p":"option.root","h":"8eceaaca03","c":"/**\r\n * @packet option.root;\r\n * @require app;\r\n */\nOption({\r\n    name:\"boot\",\r\n    option:{\r\n        override:{\r\n            onendinit:function(){\r\n                this.addChild({\r\n                    type:\"@app.main\"\r\n                });\r\n            }\r\n        }\r\n    }\r\n});"},{"p":"app","h":"3a1107c1b7","c":"/**\r\n * @packet app;\r\n * @template template.temp;\r\n * @style style.main;\r\n * @require service.project;\r\n */\nModule({\r\n    name:\"main\",\r\n    extend:\"viewgroup\",\r\n    layout:\"@temp.main\",\r\n    option:{\r\n        listType:\"@.list\"\r\n    }\r\n});\r\nModule({\r\n    name: \"list\",\r\n    extend: \"view\",\r\n    className: \"main\",\r\n    template: \"@temp.list\",\r\n    style: \"@main\",\r\n    option:{\r\n        list:[]\r\n    },\r\n    services: {\"list\": \"@project.listservice\"},\r\n    autodom:true\r\n});"},{"p":"service.project","h":"a1a5e21b9e","c":"/**\r\n * @packet service.project;\r\n * @require pipe;\r\n */\nModule({\r\n    name: \"listservice\",\r\n    extend: \"publicservice\",\r\n    init: function () {\r\n        var ths = this;\r\n        require(\"@pipe\").command(\"projectlist\", null, function (a) {\r\n            ths.data = {list:a};\r\n            ths.start();\r\n            ths.trigger();\r\n        });\r\n    }\r\n});"},{"p":"pipe","h":"ad3a684318","c":"/*\r\n * @packet pipe;\r\n */\nvar pipe={\r\n\ttasks:{},\r\n\thandler:{},\r\n\tcommand:function(type,parameters,target){\r\n\t\tif(!pipe.tasks[type]){\r\n\t\t\tpipe.tasks[type]=[];\r\n\t\t\tApp.ipc.on(type,function(e,data){\r\n\t\t\t\tvar type=data.type,data=data.data;\r\n\t\t\t\tvar a=pipe.tasks[type].shift();\r\n\t\t\t\ta.target&&a.target(data);\r\n\t\t\t\tpipe.handler[type]&&pipe.handler[type](data);\r\n\t\t\t});\r\n\t\t}\r\n\t\tpipe.tasks[type].push({\r\n\t\t\ttarget:target\r\n\t\t});\r\n\t\tApp.ipc.send(type,{\r\n\t\t\ttype:type,\r\n\t\t\tparameters:parameters\r\n\t\t});\r\n\t},\r\n\tbind:function(type,fn){\r\n\t\tif(!pipe.handler[type]){\r\n\t\t\tApp.ipc.on(type,function(e,data){\r\n\t\t\t\tpipe.handler[type]&&pipe.handler[type](data);\r\n\t\t\t});\r\n\t\t}\r\n\t\tpipe.handler[type]=fn;\r\n\t}\r\n};\r\n\r\nmodule.exports=pipe;"}],"template":[{"p":"template.temp","h":"dd0b55afc3","c":"<!--[main]--><div class=\"head\"></div><div class=\"list\"><@module type=\"{{data.listType}}\"/></div><!--[list]-->{{list data.list as item}}<div class=\"item\"><div class=\"title\">{{item.name}}</div></div>{{/list}}"}],"style":[{"p":"style.main","h":"0516e6bb5d","c":"body {\n  padding: 0;\n  margin: 0;\n  font: 12px/1.231 \"Helvetica Neue\",Helvetica Neue,Helvetica,Arial,Lantinghei SC,Hiragino Sans GB,Microsoft Yahei,sans-serif; }\n\n.item {\n  line-height: 30px;\n  border-bottom: 1px solid #D7D7D7; }\n  .item .title {\n    padding: 0 10px 0 10px; }\n"}]});